From 트레잇으로는 어떠한 타입을 다른 타입으로부터 어떻게 생성하는지 정의할 수 있습니다. 이를 이용하면 여러 타입 간에 쉽게 변환할 수 있습니다. 기본 타입 및 공용 타입은 표준 라이브러리에 수많은 From 트레잇 구현이 이미 작성되어있습니다. 그 예로, str은 String으로 쉽게 변환할 수 있죠. let my_str = "hello";
let my_string = String::from(my_str); 우리가 직접 만든 타입도 변환 방법을 정의해주면 쉽게 변환 가능합니다. use std::convert::From; #[derive(Debug)]
struct Number { value: i32,
} impl From<i32> for Number { fn from(item: i32) -> Self { Number { value: item } }
} fn main() { let num = Number::from(30); println!("내가 만든 Number {:?}", num);
}

