Into 트레잇은 단순히 From 트레잇의 반대입니다. 즉, From 트레잇이 구현된 여러분의 타입에 Into를 사용하면 from이 호출됩니다. Into 트레잇을 사용하는 대부분의 경우, 컴파일러는 알맞은 타입을 알아낼 수 없으므로 타입 명시가 필수적입니다. 하지만 이건 얻는 이점에 비하면 사소한 문제입니다. use std::convert::From; #[derive(Debug)]
struct Number { value: i32,
} impl From<i32> for Number { fn from(item: i32) -> Self { Number { value: item } }
} fn main() { let int = 5; // 타입 선언을 지워보세요 let num: Number = int.into(); println!("Number는 {:?}입니다", num);
}

