어떤 타입에 ToString 트레잇이 구현되어있다면 String으로 변환할 수 있습니다. 다만, 타입에 ToString 을 직접 구현하는 대신, fmt::Display 트레잇을 구현해 ToString 을 자동으로 생성하고 print! 에서 다룬 타입 출력도 가능하게 만들 수 있습니다. use std::fmt; struct Circle { radius: i32
} impl fmt::Display for Circle { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { write!(f, "반지름이 {}인 원", self.radius) }
} fn main() { let circle = Circle { radius: 6 }; println!("{}", circle.to_string());
}

