for in 구문은 Iterator를 통해 순회합니다. 반복자(iterator)를 만드는 가장 쉬운 방법은 범위 표기법을 사용하는 겁니다. a..b 범위 표기법은 a(포함)부터 b(제외)까지, 한 단계씩 값이 생성됩니다. FizzBuzz 문제를 while 대신 for 반복문으로 구현해보겠습니다. fn main() { // `n`은 각 회차에 따라 1, 2, ..., 100이 됩니다 for n in 1..101 { if n % 15 == 0 { println!("fizzbuzz"); } else if n % 3 == 0 { println!("fizz"); } else if n % 5 == 0 { println!("buzz"); } else { println!("{}", n); } }
} 범위의 양쪽 끝을 모두 포함하려면 a..=b를 사용합니다. 위 예제를 a..=b 표기법을 사용해 작성하면 다음과 같습니다. fn main() { // `n`은 각 회차에 따라 1, 2, ..., 100이 됩니다 for n in 1..=100 { if n % 15 == 0 { println!("fizzbuzz"); } else if n % 3 == 0 { println!("fizz"); } else if n % 5 == 0 { println!("buzz"); } else { println!("{}", n); } }
}

